                                type="confirmPassword"
                                fullWidth
                                variant='outlined'
                                required
                            />
                        </Grid>
                    </Grid>
                    <Button fullWidth type='submit' variant='contained' color='primary' className={classes.submit}>reset Password</Button>
                </form>
            </Paper>
        </Container>
    );
}

export default NewPassword;
